MultiLanguageSpellData['it'][1214920] = {name = "Razziacieli di Notte Fonda", additional_info = "1.5 s di lancio\n[q]Evoca e congeda un Razziacieli di Notte Fonda, la cui velocità dipende da dove ti trovi e dalla tua competenza in Equitazione.\n[q]\"Data la loro abitudine di calare sulle prede nel cuore della notte, un tempo i versi di questi razziacieli incutevano terrore in tutti i bambini di Draenor.\"\nMercante:\nKronnus\nZona:\nLancia da Guerra\nCosto:\n5.000\n\nMercante:\nTempah\nZona:\nScudo del Vento\nCosto:\n5.000"}
MultiLanguageSpellData['it'][1214940] = {name = "Squartacarne Ur'zul", additional_info = "1.5 s di lancio\n[q]Evoca e congeda il tuo Squartacarne Ur'zul.\n[q]\"Questo terrificante Ur'zul incorpora in sé le sue ultime vittime, creando un mostro pressoché inarrestabile. Meno male che lo tratti bene, altrimenti potresti diventare il suo prossimo spuntino.\"\nMercante:\nAridormi\nZona:\nDalaran\nCosto:\n5.000"}
MultiLanguageSpellData['it'][1214946] = {name = "Progenie di Sinestra", additional_info = "1.5 s di lancio\n[q]Evoca e congeda una Progenie di Sinestra cavalcabile, una cavalcatura volante.\n[q]\"Dopo la caduta del Bastione del Crepuscolo, dei Draghetti del Crepuscolo riuscirono a sfuggire all'influenza di Vexiona. Alcuni di questi si sono alleati con i mortali e sono disposti a far loro da destrieri.\"\nMercante:\nKiatke\nZona:\nRoccavento\nZona:\nOrgrimmar\nCosto:\n5.000"}
MultiLanguageSpellData['it'][1214974] = {name = "Quilen dal Manto Ramato", additional_info = "1.5 s di lancio\n[q]Evoca e congeda un Quilen dal Manto Ramato, la cui velocità dipende da dove ti trovi e dalla tua competenza in Equitazione.\n[q]\"Allevate nelle scuderie di Qon il Tenace, queste cavalcature sono ardentemente risolute e non abbandonano mai la loro posizione, nemmeno quando avvertirono la rovina dei loro padroni.\"\nMercante:\nTeurga del Misticismo Xia\nZona:\nIsola Senza Tempo\nCosto:\n5.000"}
